import React, { Component } from 'react';

class Landing extends Component {
  render() {
    return (
      <main>
        <header>
          <h2>Knit? Crochet? <br>
            Need to keep count of your sitches?</br></h2>
          <h1></h1>
        </header>
      </main>
    );
  }
}

export default Landing;
